description:
Verenigde Staten
Actie / Thriller
106 minuten

geregisseerd door John Singleton
met Taylor Lautner, Lily Collins en Alfred Molina

Wat zou je doen als je je eigen foto op een site met vermiste personen zou zien? Het overkomt Nathan Harper (Taylor Lautner), die op zoek gaat naar zijn ware identiteit en er al snel achterkomt dat zijn ouders totaal andere mensen zijn dan dat ze beweren. Wanneer de politie en de regering dan achter hem aan komt, zal Nathan in een race tegen de klok op zoek moeten naar de waarheid.

Vanaf 20 oktober in de bioscoop

